import React from "react";
import './ListForm.css';
import {ListContext} from '../ListContext';

function ListForm(){
    const {} = React.useContext(ListContext);

    return (
        <form onSubmit={(event) =>{
                event.preventDefault();
        }}>
            <label>Write your new food</label>
            <textarea 
                placeholder="Text to writer "
            />
            <div className="ListForm-buttonContainer">
                 <button className="ListForm-button ListForm-button--cancel" type="">
                    Cancel
                </button>
                <button className="ListForm-button ListForm-button--add" type="submit">
                    Add
                </button>
            </div>
        </form>
    );
}

export { ListForm };
